import React, { Component } from "react";

export class PersonalDetails extends Component {
  constructor() {
	  super();
	  this.state.name = ""
  }

  render() {
    return (
      <div>
        <form>
          <label htmlFor="personName" value="Personal Details"></label>
          <input
            type="text"
            id="personName"
            placeholder="Full Name"
            value="John Jones"
          ></input>
        </form>
      </div>
    );
  }
}

export default PersonalDetails;
